    function getHighTokens() public view returns (uint256 amount){
        uint256 priceChange = PairFunctions.priceChange(openPrice, closePrice);
        int256 ps = PairFunctions.calculateProfitSplit(fee, priceChange);
        uint256 rb = PairFunctions.calculateRebalancePercentage(priceChange, SLICE_POINT);
        return PairFunctions.calculateHighClosingTokens(2000000, ps, rb, priceChange);
