        highPoolSupply = highPoolSupply.add(_amount);
        emit HighTransfer(msg.sender, address(this), _amount);
        return true;
    }

    function withdrawHigh(uint256 _amount) public returns (bool) {
        require(_amount <= highBalanceOf[msg.sender]);
        IERC20 baseContract = IERC20(base);
        highBalanceOf[msg.sender] = highBalanceOf[msg.sender].sub(_amount);
        highPoolSupply = highPoolSupply.sub(_amount);        
        emit HighTransfer(address(this), msg.sender, _amount);
        return baseContract.transfer(msg.sender, _amount);
    }

    function mintLowToken(uint256 _amount) public returns (bool) {
